"""
Week 3, Day 7: Count Square Submatrices with All Ones

Given a m * n matrix of ones and zeros, return how many square submatrices have all ones.

Constraints:

    1 <= arr.length <= 300
    1 <= arr[0].length <= 300
    0 <= arr[i][j] <= 1

Hints:

    (1) Create an additive table that counts the sum of elements of submatrix with the superior corner at (0,0).
    (2) Loop over all subsquares in O(n^3) and check if the sum make the whole array to be ones, if it checks
        then add 1 to the answer.

Examples:

    Input: matrix =
        [
          [0,1,1,1],
          [1,1,1,1],
          [0,1,1,1]
        ]
    Output: 15
    Explanation:
        There are 10 squares of side 1.
        There are 4 squares of side 2.
        There is  1 square of side 3.
        Total number of squares = 10 + 4 + 1 = 15.

    Input: matrix =
        [
          [1,0,1],
          [1,1,0],
          [1,1,0]
        ]
    Output: 7
    Explanation:
        There are 6 squares of side 1.
        There is 1 square of side 2.
        Total number of squares = 6 + 1 = 7.

"""
from collections import defaultdict
from typing import List


class Solution:
    """Slow."""

    def countSquares(self, matrix: List[List[int]]) -> int:
        def all_ones(ones_index, row, col, size):
            for y in range(row, row + size):
                for x in range(col, col + size):
                    if x not in ones_index[y]:
                        return 0
            return 1

        height, width = len(matrix), len(matrix[0])
        max_size = min(height, width)
        ones_index = {}
        answer = 0
        for row in range(height):
            ones_index[row] = []
            for col in range(width):
                if matrix[row][col]:
                    ones_index[row].append(col)
                    answer += 1
        for size in range(2, max_size + 1):
            for row, cols in ones_index.items():
                h = height - size
                for col in cols:
                    w = width - size
                    if row <= h and col <= w:
                        answer += all_ones(ones_index, row, col, size)
        return answer


class SolutionV2:
    """This has acceptable run time (small 1000 ms range)."""

    def countSquares(self, matrix: List[List[int]]) -> int:
        height, width = len(matrix), len(matrix[0])
        ones_in_a_row = {}
        answer = 0
        for row in range(height):
            ones_in_a_row[row] = defaultdict(list)
            ones = 0
            for col, element in enumerate(matrix[row]):
                if element:
                    ones += 1
                    answer += 1
                    for n in range(1, ones + 1):
                        ones_in_a_row[row][n] += list(range(col, col - n, -n))
                else:
                    ones = 0
        for size in range(2, min(height, width) + 1):
            for row in range(height - size + 1):
                for index in ones_in_a_row[row][size]:
                    for offset in range(row + 1, row + size):
                        if index not in ones_in_a_row[offset][size]:
                            break
                    else:
                        answer += 1
        return answer


